;; **
;;; ## Evolution of Averages
;; **

;; @@
(defn plot-degree-evolution [coll]
(let [curr (map :mean (degree t0 tmax :evolution coll))
       dat {:ltncs curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :ltncs]]
         [:geom_line {:color "steelblue"}]
         [:xlab "Day"]
         [:ylab "Average degree"]
         [:theme_bw]
         [:ggtitle (str "Average degree evolution of " coll)])]
      {:width 5 :height 5})))
